div.p:
Lundy â neuf heures Du Matin Nous appareillame Et Sortimes avec les Vx Du Roy L'invincible et Le Jazon et plusieurs navires De La Compagnies des Inde qui fure mouille Sous Grois, mais Nous poursuivimes notre Routte voullan Trouver Les glenant ou Lon nous dit quil y avoit des Corsaires anglais ; Mais Nayent Rien apperçue dedans Nous fimes une Bordé au Large le Cap au SO. les vent au NE Bon frais ; Sur les 6 heures Du Soire Nous umes Connaissance d'une Voille qui Chassois Sur Nous ; aussitot Nous Revisame de Bord et Courume pour en avoir mieux
De Connoissance ; peut de tems apres La Vegie q Cria Quel En voyait plusieurs quel Contoit au nombre de Trante trois Nous presumames que Sestoit Le Convois des Barques Bretonne et altoit a Nantes ; mais Celuy que Nous appercume Le premier nous le prime pour un Corsaire anglois vûe quils Estoit Tres Eloigne de La flottes ; Nous ayent joint et nous tres Disposé aux Combats Le dit navire nous anvoyat un Coup de Canon a Boullet Comme Nous Estions au Vent a luy et Ne pouvoit Nous voire notre pavillon nous Donnames un Elans en Luy Envoyent un coups de Canon a boulet pour luy assurer notre Pavillon ; malgré cette assurance il nous tira huit Coup de Canon, Nous Vime Bien que Cestait La decouverte de La Flotte nous arrivames par sous Le Vent a Luy affin de Luy Parler ; nous helas demandant dous nous estions ont Luy Repondit fregatte du Roy de Rochefort et estant Par Son Traver Nous Le Saluame de Sept Vive le Roy, et luy Repondit de sept autres Vive Le Roy et nous Dit quil y avait un Corsaire qui estait a Raudé aux environ des glenant, sur les huit heures du soir Nous apercume Un Navire venans a nostre Rencontre qui nous parûs Estre Disposé au combats ayent Distingué Ses Fanaux Entre Les Postes De Canon ; estant a Porté de Canon. Il nous appercue estant Disposé pareilllement Que Luy. a Combat. voyant sa il vira De bord pour nous Eviter. mais aussitots ayent appercue Sa Maneuvre ; Nous voullumes forcer De Voilles, mais La Mauvaise Calité De La Fregatte ; nous Trompan Baucoup car elle ne pouvais Porter De Voille quoy que Le Tems ne demandoit au Qu'une precaution sur Les Voillures d'un vxvaisseau ; nous
Numen'eûmes donc pas plustot amuré Nostre grand Voille que Nostre fregatte se Couchá et nayent pas eut le Tems de maneuvrer pour Eviter Lespace de Six minuttes dampecher La fregatte dambarquer de leau par son grand Panneau ou Tout un chachun se Jettoit sur le Bord du Cotté du Vent de ladte fregatte ayent perdûe Touttes Esperances De Vie Criayt mais dieu pourvoyant a Tout et ayent manevrer apropos La fregatte se Releva aussitots, Nous, chercham plus a donner chasse au Dit Vxvaisseau et faisant Routte pour Relacher, les vents Estant Propre pour donner O dans Lisle Day. Nous y fimes Routtes ;
